import React, { Component } from 'react'
import './Banner.css';

export default class Banner extends Component {
    render() {
        return (
            <div className="continner">
                <div className="banner">
                    <img src="https://ak-d.tripcdn.com/images/20091900000160su53C97_R_550_412_R5_Q70_D.jpg"  alt="Banner"  height="40"/>
                </div>
            </div>
        )
    }
}
